INSERT INTO `catalog_category_entity_text` VALUES (1,47,0,2,NULL),(2,50,0,2,NULL),(3,51,0,2,NULL),(6,50,0,4,'đồ uống, thức uống giải khát, nước giải khát, cà phê, sinh tố, nước ép trái cây, đồ uống có ga, trà, nước ngọt, thức uống healthy'),(7,51,0,4,'Khám phá thế giới đồ uống đa dạng với các loại nước giải khát, cà phê, sinh tố tươi ngon. Thức uống chất lượng, giá tốt, giao hàng nhanh. Đặt ngay hôm nay!'),(8,50,0,5,'thức ăn nhanh,\r\nfast food,\r\nđồ ăn nhanh,\r\ngà rán,\r\nhamburger,\r\npizza,\r\nmì Ý,\r\nkhoai tây chiên,\r\nsandwich,\r\nđồ ăn giao nhanh,\r\ncơm gà,\r\ngà giòn,\r\ncombo thức ăn nhanh'),(9,51,0,5,'Đặt đồ ăn nhanh ngon, đa dạng: gà rán, hamburger, pizza, mì Ý, khoai tây chiên... Giao hàng nóng hổi trong 30 phút. Ưu đãi hấp dẫn mỗi ngày. Order ngay!'),(10,50,0,6,'Khám phá tinh hoa ẩm thực Á-Âu với đa dạng món ngon từ các nền văn hóa. Beefsteak, mỳ Ý, sushi, dimsum... được chế biến bởi đầu bếp chuyên nghiệp. Đặt món ngay!'),(11,51,0,6,'món Á Âu,\r\nẩm thực Á Âu,\r\nnhà hàng Á Âu,\r\nbeefsteak,\r\nmỳ Ý,\r\npasta,\r\nsushi,\r\ndimsum,\r\nfusion food,\r\nmón Âu,\r\nmón Á,\r\nsteak bò,\r\ncơm chiên dương châu,\r\nsalad,\r\nsúp,\r\nseafood,\r\nhải sản Á Âu,\r\nfine dining'),(12,50,0,7,'cơm trưa văn phòng, cơm hộp, cơm gà, cơm sườn, cơm tấm, cơm rang, suất cơm công nghiệp, cơm phần, cơm giao tận nơi'),(13,51,0,7,'Đặt cơm online đa dạng: cơm gà, cơm sườn, cơm rang, cơm văn phòng. Món ăn kèm phong phú, cơm nóng hổi, giao tận nơi. Ưu đãi giảm giá mỗi ngày!'),(16,50,0,9,'món chay, nhà hàng chay, cơm chay, dimsum chay, chay healthy, đồ ăn chay, thực phẩm chay, buffet chay, ăn chay, chay thanh tịnh'),(17,51,0,9,'Thực đơn món chay đa dạng, healthy từ rau củ tươi ngon. Cơm chay, phở chay, dimsum chay... Giao hàng tận nơi.'),(18,50,0,10,'phở bò, bún bò Huế, bún riêu, bún chả, phở gà, bún đậu, bún thang, phở nam, phở bắc, bún phở delivery'),(19,51,0,10,'Thưởng thức bún phở Việt Nam chuẩn vị với nước dùng ngon, thịt tươi. Phở bò, bún bò, bún riêu, bún chả... Giao nóng tận nơi trong 30 phút!'),(20,50,0,11,'đồ ăn vặt, ăn vặt online, bánh tráng trộn, tokbokki, takoyaki, gà popcorn, xúc xích, trứng gà nướng, ăn vặt Hàn Quốc, snack'),(21,51,0,11,'Khám phá thiên đường ăn vặt với đủ loại bánh tráng, gà ráng, trứng gà nướng, tokbokki... Đồ ăn vặt Việt - Hàn - Nhật. Ship nhanh, giá rẻ!'),(22,47,0,5,NULL),(23,50,0,12,'ưu đãi đặt đồ ăn, khuyến mãi đồ ăn, đặt món online, giao đồ ăn nhanh'),(24,51,0,12,'Tận hưởng ưu đãi đặt đồ ăn hấp dẫn, giao hàng siêu nhanh, giá cực rẻ.');
